import React, { useState } from 'react';
import axios from 'axios';
import './App.css';

function App() {
    const [ingredients, setIngredients] = useState('');
    const [context, setContext] = useState('');
    const [selectedModel, setSelectedModel] = useState('cohere'); // Default to 'cohere'
    const [prompt, setPrompt] = useState('');
    const [response, setResponse] = useState('');
    const [recipes, setRecipes] = useState([]);

    const handleQuery = async () => {
        try {
            const result = await axios.post('http://localhost:5002/query', { query: ingredients });
            setRecipes(result.data.recipes);
            setContext(result.data.context);
        } catch (error) {
            console.error('Error querying recipes:', error);
        }
    };

    const handleGenerate = async () => {
        try {
            const result = await axios.post('http://localhost:5002/generate', { context, prompt, model: selectedModel });
            setResponse(result.data.response);
        } catch (error) {
            console.error('Error generating response:', error);
        }
    };

    return (
        <div className="App">
            <h1>Recipe Chatbot</h1>
            <div>
                <input
                    type="text"
                    value={ingredients}
                    onChange={(e) => setIngredients(e.target.value)}
                    placeholder="Enter ingredients"
                />
                <button onClick={handleQuery}>Get Recipes</button>
            </div>
            {recipes.length > 0 && (
                <div>
                    <h2>Recipes:</h2>
                    {recipes.map((recipe, index) => (
                        <div key={index} className="recipe">
                            <h3>{recipe.RecipeName}</h3>
                            <p><strong>Ingredients:</strong> {recipe.Ingredients}</p>
                            <p><strong>Diet:</strong> {recipe.Diet}</p>
                            <p><strong>Course:</strong> {recipe.Course}</p>
                            <p><strong>Servings:</strong> {recipe.Servings}</p>
                            <p><strong>Preparation Time (Min):</strong> {recipe.PrepTimeInMins}</p>
                            <p><strong>Cooking Time (Min):</strong> {recipe.CookTimeInMins}</p>
                            <p><strong>Total Time (Min):</strong> {recipe.TotalTimeInMins}</p>
                            <p><strong>Instructions:</strong> {recipe.Instructions}</p>
                            <p><strong>URL:</strong> <a href={recipe.URL} target="_blank" rel="noopener noreferrer">{recipe.URL}</a></p>
                            {recipe['image-url'] && <img src={recipe['image-url']} alt="Recipe" />}
                        </div>
                    ))}
                </div>
            )}
            {context && (
                <div>
                    <h2>Context:</h2>
                    <p>{context}</p>
                </div>
            )}
            <div>
                <input
                    type="text"
                    value={prompt}
                    onChange={(e) => setPrompt(e.target.value)}
                    placeholder="Enter your question"
                />
                <select value={selectedModel} onChange={(e) => setSelectedModel(e.target.value)}>
                    <option value="cohere">Cohere</option>
                    <option value="google">Google</option>
                </select>
                <button onClick={handleGenerate}>Ask</button>
            </div>
            {response && (
                <div>
                    <h2>Response:</h2>
                    <p>{response}</p>
                </div>
            )}
        </div>
    );
}

export default App;
